import React from "react";
import Footer from "./footer";
import Contact from "./contact";
import { IoMdContacts } from "react-icons/io";
import { FcAbout } from "react-icons/fc";
import { FaHtml5, FaCss3, FaNode, FaReact, FaAngular } from "react-icons/fa";
import { DiJavascript1 } from "react-icons/di";
import { TiTick } from "react-icons/ti";
import service from "./serviceArray";
import Services from "./services"


const Home = () => {
  const image =
    "data:image/jpg;base64,";
  const homestyle = {
    background: `linear-gradient( rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5) ),url(${image})`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    backgroundBlendMood: "luminosity"
  };
  const smallHeading = {
    display: "inline-flex",
    fontWeight: "200",
    color: "hsl(180, 66%, 49%)",
    margin: "0"
  };
  return (
    <div>
    <div className="row" v style={homestyle}>
      <div className="col-7">
        <h2 className="heading">Hi, I'm Stanley Ifeoha</h2>
        <h6 style={smallHeading}>--Fullstack Web Developer</h6>
      </div>
      <div className="col-7">
        <p className="para" style={{margin:"0 30%"}}>
          <table>
            <tbody>
              <tr>
                <td>
                  <FaHtml5 />
                </td>
                <td>HTML5</td>
                <td>
                  <TiTick />
                </td>
              </tr>
              <tr>
                <td>
                  <FaCss3 />
                </td>
                <td>CSS3</td>
                <td>
                  <TiTick />
                </td>
              </tr>
              <tr>
                <td>
                  <DiJavascript1 />
                </td>
                <td>Javascript</td>
                <td>
                  <TiTick />
                </td>
              </tr>
              <tr>
                <td>
                  <FaNode />
                </td>
                <td>NodeJs</td>
                <td>
                  <TiTick />
                </td>
              </tr>
              <tr>
                <td>
                  <FaReact />
                </td>
                <td>React</td>
                <td>
                  <TiTick />
                </td>
              </tr>
              <tr>
                <td>
                  <FaAngular />
                </td>
                <td> Angular </td>
                <td>
                  <TiTick />
                </td>
              </tr>
            </tbody>
          </table>
        </p>
      </div>
      <div className="h-p">
        <p className="paragraph">
        I build a Web presence from the ground up -- from concept, navigation, responsive webpage, beautiful user interface and engaging user experience.
        </p>
      </div>
      <div className="col-8">
        <button className="btn-f">
          <table>
            <tbody>
              <tr>
                <td>
                  <IoMdContacts className="component-menu" />
                </td>
                <td>Hire Me</td>
              </tr>
            </tbody>
          </table>
        </button>
      </div>
      <div className="col-8">
        <button className="btn-f">
          <table>
            <tbody>
              <tr>
                <td>
                  <FcAbout className="component-menu" />
                </td>
                <td>About Me </td>
              </tr>
            </tbody>
          </table>
        </button>
      </div>

    </div>
    {service.map((element)=>{
   const {id,title,content,icon} = element;
      return(
        <Services key={id} title={title} content={content} icon={icon} />
      )
    })}
    <Contact />
    <Footer />
    </div>
  );
};

export default Home;
